import './App.css';
import React from 'react';
import Views from './pages/Views';
import Navbar from './components/Navbar/index';
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar/>
      <Views/>
    </Router>
  );
}

export default App;
